import {StyleSheet, View, Text, StatusBar, SafeAreaView, Image, Alert, Button} from 'react-native'
import * as React from 'react';
import { MaterialIcons } from '@expo/vector-icons';
import {createNativeStackNavigator} from '@react-navigation/native-stack'
import { NavigationContainer } from '@react-navigation/native';
import { Overview } from '../routes/Overview';


const Stack = createNativeStackNavigator();

export function Progress() {
  const ref = React.useRef(null);
  function Default() {
    return(
      <View>  
        <Text>Default Page</Text>
        <Button 
          title="Overview"
          color='#2196F3'
          onPress={() => {ref.current && ref.current.navigate('Overview')}}
        /> 
        </View>
      );
  }

  return (
      <View style={styles.container}>
        <NavigationContainer independent={true} ref={ref}>
          <Stack.Navigator initialRouteName="Default">
            <Stack.Screen name="Default" component={Default} options={{ headerShown: false }}/>
            <Stack.Screen name="Overview" component={Overview} options={{ headerShown: false }}/>
          </Stack.Navigator>
        </NavigationContainer>  
      </View>
    )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
